//分割法，把队列中面积最大图找出一个0并分割为4个小图，循环至最大图无0 o(mnlg(mn))
class Solution {
    struct Rect {
        int size;
        int x0, y0, x1, y1;
        bool operator <(const Rect &r) const{
            if(size != r.size)
                return size > r.size;
            if(x0 != r.x0)
                return x0 < r.x0;
            if(y0 != r.y0)
                return y0 < r.y0;
            if(x1 != r.x1)
                return x1 < r.x1;
            return y1 < r.y1;
        }
    };
public:
    int maximalRectangle(vector<vector<char>>& matrix) {
        if(matrix.size() == 0)
            return 0;
        int H = matrix.size();
        int W = matrix[0].size();
        set<Rect> rects;
        rects.emplace(Rect{H*W, 0, 0, H-1, W-1});
        while(!rects.empty()) {
            auto &i = *rects.begin();
            int x, y;
            [&] {
                for(x = i.x0; x <= i.x1; x++)
                    for(y = i.y0; y <= i.y1; y++)
                        if(matrix[x][y] == '0')
                            return;
            }();
            if(x > i.x1)
                return i.size;

            if(x > i.x0)
                rects.emplace(Rect{(x-i.x0)*(i.y1-i.y0+1), i.x0, i.y0, x-1, i.y1});
            if(y > i.y0)
                rects.emplace(Rect{(i.x1-i.x0+1)*(y-i.y0), i.x0, i.y0, i.x1, y-1});
            if(i.y1 > y)
                rects.emplace(Rect{(i.x1-i.x0+1)*(i.y1-y), i.x0, y+1, i.x1, i.y1});
            if(i.x1 > x)
                rects.emplace(Rect{(i.x1-x)*(i.y1-i.y0+1), x+1, i.y0, i.x1, i.y1});
            rects.erase(rects.begin());
        }
        return 0;
    }
};
#elif S == 2
//补多法，二维0084 o(mn)
class Solution {
    int largestRectangleArea(vector<int> &height) {
        stack<int> s;
        height.push_back(0);
        int maxSize = 0;
        for(int i = 0; i < height.size(); i++){
            if(s.empty() || height[i] >= height[s.top()]){
                s.push(i);
            }
            else{
                int temp = height[s.top()];
                s.pop();
                maxSize = max(maxSize, temp * (s.empty() ? i : i - 1 - s.top()));
                i--;
            }
        }
        return maxSize;
    }
public:
    int maximalRectangle(vector<vector<char>>& matrix) {
        if (matrix.empty()) {
            return 0;
        }
        int maxRec = 0;
        vector<int> height(matrix[0].size(), 0);
        for (int i = 0; i < matrix.size(); i++) {
            for (int j = 0; j < matrix[0].size(); j++) {
                if (matrix[i][j] == '0') {
                    height[j] = 0;
                } else {
                    height[j]++;
                }
            }
            maxRec = max(maxRec, this->largestRectangleArea(height));
        }
        return maxRec;
    }
};
